import axios from "axios";
export const keys = [
  "sl_no",
  "customer_order_id",
  "sales_org",
  "distribution_channel",
  "company_code",
  "order_creation_date",
  "order_amount",
  "order_currency",
  "customer_number",
  "amount_in_usd",
  "isOpen",
  "aging_bucket",
  "is_deleted",
];
export const getData = async () => {
  let response = await axios.get("http://localhost:8080/HRC_Final/");

  console.log(response);
  return response.data;
};
